import React from "react";
import { useState } from "react";
import { Link } from "react-router-dom";
import style from '../Form/Form.component.css';

function Form () {
    return (
        <div>
            <div class="wrapper fadeInDown">
                <div id="formContent">
                    <h2 className="form-title">Login</h2>
                    <form className={style.fadeIN}>
                        <label className="form-label">Email</label>
                        <input className="input-field" name='email' type="text" placeholder="Write a valid email"></input>
                        <br />
                        <label className="form-label">Password</label>
                        <input className="input-field" name="password" type="password" placeholder="Here your password"></input>
                        <button className="submit-btn">Submit</button>
                    </form>
                </div>
            </div>
        </div>
    )
};

export default Form;
